import porto1 from '../images/porto1.png';
import porto2 from '../images/porto2.png';
import porto3 from '../images/porto3.png';
import porto4 from '../images/porto4.png';
import porto5 from '../images/porto5.png';
import porto6 from '../images/porto6.png';

const image = () => {
    let gambar = [porto1,porto2,porto3,porto4,porto5,porto6];
    return gambar;
}

export default image;
